script: |
  super -f text -I q11140.spq | sort > q11140.out

inputs:
  - name: q11140.spq
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( - col0 + CAST ( NULL AS INTEGER ) ) NOT BETWEEN NULL AND + 59 OR NOT ( + col1 ) IS NULL;
  - name: tab2

outputs:
  - name: q11140.out
    data: |
      23
      40
      58
